Дизайн-проект содержит:
1. Финальная планировка квартиры (на основе 3 вариантов);
2. Коллажная визуализация каждой комнаты (как на фото);
3. План демонтажа и монтажа стен и перегородок;
4. План напольных покрытий с расчетом материалов;
5. План теплых полов с регуляторами;
6. План потолков;
7. План расположения розеток (электрика);
8. План расстановки светильников и групп включения (электрика);
9. Развертки всех помещений квартиры с расчетом материалов;
10. Список отделочных материалов с расчетом количества;
11. Список всех использованных материалов и предметов мебели.

